import React from 'react';
import { motion } from 'framer-motion';

const FadeIn = ({ children, delay = 0 }) => (
  <motion.div
    initial={{ opacity: 0, y: 12 }}
    animate={{ opacity: 1, y: 0 }}
    transition={{ duration: 0.6, delay }}
  >
    {children}
  </motion.div>
);

export default function YakushkinPortfolio() {
  return (
    <div style={{
      minHeight: '100vh',
      backgroundImage: 'linear-gradient(135deg, #fdf6e3, #f0f9ff, #e6f7f1)',
      backgroundRepeat: 'no-repeat',
      backgroundSize: 'cover',
      color: '#1e293b',
      display: 'flex',
      flexDirection: 'column'
    }}>
      {/* Hero */}
      <section style={{ display: 'flex', flexDirection: 'column', justifyContent: 'center', alignItems: 'center', flexGrow: 1, padding: '4rem 2rem' }}>
        <FadeIn>
          <h1 style={{ fontSize: '3rem', marginBottom: '1rem' }}>–Ø–∫—É—à–∫–∏–Ω –î.–û.</h1>
        </FadeIn>
        <FadeIn delay={0.1}>
          <p style={{ fontSize: '1.25rem', maxWidth: '600px', textAlign: 'center' }}>
            –ò–Ω–¥–∏–≤–∏–¥—É–∞–ª—å–Ω—ã–π –ø—Ä–µ–¥–ø—Ä–∏–Ω–∏–º–∞—Ç–µ–ª—å –≤ —Å—Ç—Ä–æ–∏—Ç–µ–ª—å—Å—Ç–≤–µ. –ö–æ–º–∞–Ω–¥–∞ –æ–ø—ã—Ç–Ω—ã—Ö –º–∞—Å—Ç–µ—Ä–æ–≤, –æ—Ä–∏–µ–Ω—Ç–∏—Ä–æ–≤–∞–Ω–Ω—ã—Ö –Ω–∞ —Ä–µ–∑—É–ª—å—Ç–∞—Ç.
          </p>
        </FadeIn>
      </section>

      {/* About */}
      <section style={{ maxWidth: '800px', margin: '0 auto', padding: '2rem' }}>
        <FadeIn>
          <h2 style={{ fontSize: '2rem', marginBottom: '1rem' }}>–û –Ω–∞—Å</h2>
          <p>
            –ú—ã ‚Äî —Å–ª–∞–∂–µ–Ω–Ω–∞—è –±—Ä–∏–≥–∞–¥–∞ —Å–ø–µ—Ü–∏–∞–ª–∏—Å—Ç–æ–≤, –≤—ã–ø–æ–ª–Ω—è—é—â–∞—è —Å—Ç—Ä–æ–∏—Ç–µ–ª—å–Ω—ã–µ –∏ —Ä–µ–º–æ–Ω—Ç–Ω—ã–µ —Ä–∞–±–æ—Ç—ã –ª—é–±–æ–π —Å–ª–æ–∂–Ω–æ—Å—Ç–∏. –ù–∞ –Ω–∞—à–µ–º —Å—á–µ—Ç—É –º–Ω–æ–∂–µ—Å—Ç–≤–æ —Ä–µ–∞–ª–∏–∑–æ–≤–∞–Ω–Ω—ã—Ö –æ–±—ä–µ–∫—Ç–æ–≤ ‚Äî –æ—Ç –∑–∞–≥–æ—Ä–æ–¥–Ω—ã—Ö –¥–æ–º–æ–≤ –¥–æ –∫–æ–º–º–µ—Ä—á–µ—Å–∫–∏—Ö –ø–æ–º–µ—â–µ–Ω–∏–π. –†–∞–±–æ—Ç–∞–µ–º –æ—Ç–≤–µ—Ç—Å—Ç–≤–µ–Ω–Ω–æ –∏ —Å–ª–∞–∂–µ–Ω–Ω–æ, —Ü–µ–Ω–∏–º –¥–æ–≤–µ—Ä–∏–µ –∏ –ø—Ä–æ—Ñ–µ—Å—Å–∏–æ–Ω–∞–ª–∏–∑–º.
          </p>
        </FadeIn>
      </section>

      {/* Contact */}
      <section style={{ maxWidth: '600px', margin: '0 auto', padding: '2rem' }}>
        <FadeIn>
          <h2 style={{ fontSize: '2rem', marginBottom: '1rem' }}>–°–≤—è–∑–∞—Ç—å—Å—è</h2>
          <p style={{ marginBottom: '1rem' }}>–ü–æ–∑–≤–æ–Ω–∏—Ç–µ –∏–ª–∏ –Ω–∞–ø–∏—à–∏—Ç–µ –Ω–∞–º, —á—Ç–æ–±—ã –æ–±—Å—É–¥–∏—Ç—å –≤–∞—à –ø—Ä–æ–µ–∫—Ç.</p>
          <p>üìû +7 953 447-12-18</p>
          <p>üìß dimayakyshkin6@mail.ru</p>
        </FadeIn>
      </section>

      {/* Footer */}
      <footer style={{ textAlign: 'center', padding: '2rem', fontSize: '0.875rem', color: '#64748b' }}>
        ¬© {new Date().getFullYear()} –Ø–∫—É—à–∫–∏–Ω –î.–û. –í—Å–µ –ø—Ä–∞–≤–∞ –∑–∞—â–∏—â–µ–Ω—ã.
      </footer>
    </div>
  );
}
